INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (0, "フリーマーケット会場", 7, "青空の下で謁見", 0, 10118, 40, 1, 2, 2834, "ペコリーヌとの出会い", 8, 91002, 5118061, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。");
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (0, "フリーマーケット会場", 7, "未来の騎空団\nマスコット？", 0, 10118, 40, 1, 2, 2835, "マホとの出会い", 8, 91002, 5118062, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。");
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (0, "ランドソル市街地", 7, "お嬢さまからの\n緊急依頼", 0, 10118, 40, 1, 2, 2837, "アキノとの出会い", 8, 91002, 5118063, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。");
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (0, "フリーマーケット会場", 18, "黄金色の悩みごと", 0, 10118, 40, 1, 2, 4108402, "ジュンとの出会い", 8, 91002, 5118064, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。");
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (0, "フリーマーケット会場", 18, "白熱！　格闘大会！", 0, 10118, 40, 1, 2, 4107402, "カオリとの出会い", 8, 91002, 5118065, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？");
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (0, "オーエド町", 16, "祭り太鼓はオーエドの華", 1, 10118, 40, 1, 2, 9000227, "ニノンとの出会い", 8, 91002, 5118066, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。");
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (0, "フリーマーケット会場", 19, "人気者は遅れて\nやってくる", 0, 10118, 40, 1, 3, 2101181, "スズナとの出会い", 8, 91002, 5118067, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？");
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (0, "ランドソル市街地", 18, "巫女・ミーツ・魔法少女", 0, 10118, 40, 1, 3, 4109402, "ナナカとの出会い", 8, 91002, 5118068, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？");
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (0, "フリーマーケット会場", 18, "ネズ耳は二度なくなる", 0, 10118, 40, 1, 3, 4305402, "キャル＆コッコロとの出会い", 8, 91002, 5118069, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……");
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (0, "ランドソル市街地", 18, "この出会いにカンパイ！", 0, 10118, 40, 1, 3, 4101402, "ユカリとの出会い", 8, 91002, 5118070, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。");
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (0, "ランドソル市街地", 18, "陰陽アンサンブル", 0, 10118, 40, 1, 3, 4106402, "アオイとの出会い", 8, 91002, 5118071, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……");
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (0, "フリーマーケット会場", 7, "運試し十番勝負！", 1, 10118, 40, 1, 3, 2836, "シノブとの出会い", 8, 91002, 5118072, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。");
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (10145115, 0, 0, "彼女たちの新たな日常", 0, 10118, 0, 0, 1, 0, "オープニング", 0, 0, 5118600, 0);
